    [],nt"revision_timestamp": "2015-05-07T02:02:13.330897",nt"name": "npp-temperate-forest-humboldt-redwoods-state-park-california-u-s-a-1972-2001",nt"isopen":
    true,nt"url": null,nt"notes": "ABSTRACT: Productivity of an old stand of
    coast redwoods in northern California was studied via tree remeasurement (1972-2001)
    and allometric relationships.  Measurements of tree circumference at 1.7 m above
    ground were made at the beginning and the end of the study.  Above-ground net primary
    production (ANPP) was estimated using a range of specific gravities and several
    allometric relationships for tree volume.  Trees lost to mortality over the study
    interval were included in the analysis. Reported data include site characteristics,
    redwood stand descriptors, and measured and calculated biomass and ANPP data.",nt"license_title":
